import React from 'react';
import './PartyTable.css';

const PartyTable = ({ partyData }) => {
    return (
        <div className="party-table-container">
            <h1>RSVP Status</h1>
            <table className="party-table">
                <thead>
                    <tr>
                        <th>Name</th>
                        <th>Email</th>
                        <th>RSVP Status</th>
                        <th>Number of Guests</th>
                    </tr>
                </thead>
                <tbody>
                    {partyData.map((entry, index) => (
                        <tr key={index}>
                            <td>{entry.name}</td>
                            <td>{entry.email}</td>
                            <td>{entry.rsvpStatus}</td>
                            <td>{entry.numGuests}</td>
                        </tr>
                    ))}
                </tbody>
            </table>
        </div>
    );
};

export default PartyTable;
